    },
    {
      id: '2',
      title: 'Studing Vue JS',
      completed: true,
    },
    {
      id: '2',
      title: 'Studing Adonis JS',
      completed: true,
    }

  ])

  return <>
    <div className='container'>
      <Tasks tasks= {tasks} />
    </div>
  </>
}

export default App;
